import React, { useMemo, useState } from "react";
import { ImSpoonKnife } from "react-icons/im";
import { BsCartFill } from "react-icons/bs";
import { Modal, Button } from "react-bootstrap";
import { Link } from "react-router-dom";
import "./head.css";
import Card from "../card/Card";
import useGetCardData from "../useGetCardData";
const Header = (props) => {
  const [mod, setMod] = useState(false);
 const { coke,fries,count,setCoke,setFries, setCount} =  useGetCardData();

  return (
    <div>
      <ul>
        <li>
          <ImSpoonKnife className="I" />
        </li>
        <li>
          <a href="#about">
            <h5>Food's Restaurant</h5>
          </a>
        </li>
        <li>
          <BsCartFill className="cart" onClick={() => setMod(true)} />
        </li>
      </ul>
      <Modal show={mod}>
        <Modal.Header>Thank You</Modal.Header>

        <Modal.Body> {coke}</Modal.Body>
        <Modal.Footer>
          <Link to="/thanku">
            <Button onClick={mod}>Save and Checkout</Button>
          </Link>
           <Button onClick={()=>setMod(false)}>Cancel</Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
};
export default Header;
